/**
 * Created by abhiram on 6/1/20.
 */
export const STATUS_ACTIVE = 1;
export const STATUS_INACTIVE = 0;

export const MESSAGES = {
    SOMETHING_WENT_WRONG: 'Something went wrong'
};

export const STATUS_CODES = {
    HTTP_400: 400,
    HTTP_401: 401,
    HTTP_403: 403,
    HTTP_404: 404,
    HTTP_409: 409,
    HTTP_422: 422,
    HTTP_500: 500,
    HTTP_501: 501,
};
